def tune_perceptron(trainx, trainy, epochList):
    """
    Tune the perceptron to find the optimal number of epochs

    Parameters
    ----------
    trainx : a nxd numpy array
        The input from either binary / count matrix
    trainy : numpy 1d array of shape n
        The true label.
    epochList: a list of positive integers
        The epoch list to search over

    Returns
    -------
    epoch : int
        The optimal number of epochs
    """
    k = 5
    mistake_count_list = []
    min_mistake = 99999999
    optimal_epoch = 0

    kf = KFold(n_splits=k)
    train_mistake_overall = []
    test_mistake_overall = []

    for epoch in epochList:
        #print(epoch, 'is executing')
        avg_mistake = 0
        train_mistake = []
        for train_index, test_index in kf.split(trainx):
            xTrain, xTest = trainx[train_index], trainx[test_index]
            yTrain, yTest = trainy[train_index], trainy[test_index]

            perceptron = Perceptron(epoch)
            stats = perceptron.train(xTrain, yTrain)
            #print(stats)
            train_mistake.append(stats[epoch])

            y_result = perceptron.predict(xTest)
            mistake_count = calc_mistakes(y_result, yTest)
            avg_mistake += mistake_count  # test mistakes
        #print('train_mistake', train_mistake)
        #print('avg_train_mistake:', np.average(train_mistake))
        train_mistake_overall.append(np.average(train_mistake))

        avg_mistake /= k  # average mistake for this specific epoch
        mistake_count_list.append(avg_mistake)  # average mistake for this epoch
        #print(epoch, "'s avg_mistake", avg_mistake)
        test_mistake_overall.append(avg_mistake)

        if avg_mistake < min_mistake:
            min_mistake = avg_mistake
            optimal_epoch = epoch

        #print(epoch, "'s min_test_mistake:", min_mistake)
        #print('all train_mistakes:', train_mistake_overall)
        #print('all test_mistakes:', test_mistake_overall)
        #print('\n')
    #print("optimal epoch: ")

    return optimal_epoch


